    const [selectedChatroom, setChatroom] = useState('');
    const handleSelectChatroom = (chatroom) => {
        setChatroom(chatroom);
    }

    return (
        <div className="App">
            <DisplayChatrooms setChatroom={handleSelectChatroom}/>
            <SendMsg chat_id={selectedChatroom}/>
        </div>
    )
}
export default Test;
